import React from 'react'
import ReactDom from 'react-dom';
import { useForm, ErrorMessage } from "react-hook-form";
import { Route, Router, Link, useLocation } from "react-router-dom";
import { StateMachineProvider, createStore } from "little-state-machine";
import __RegistrationForm1 from './__RegistrationForm1';


createStore({
    yourDetails: {
        firstName: "",
        lastName: "",
        age: ""
    }
})
const __RegistrationForm = () => {

    const location = useLocation();

    return (
        <>
            <nav className="container">
                <ul className="steps">
                    <li className={location.pathname === "/" ? "active" : ""}>
                        <Link to="/">Step 1</Link>
                    </li>
                    {/* <li className={location.pathname === "/step2" ? "active" : ""}>
                        <Link to="/step2">Step 2</Link>
                    </li>
                    <li className={location.pathname === "/result" ? "active" : ""}>
                        <Link to="/result">Result</Link>
                    </li> */}
                </ul>
            </nav>
            <Route exact path="/" component={__RegistrationForm1} />
            {/* <Route path="/step2" component={Step2} />
            <Route path="/result" component={Result} /> */}
        </>
    )
}

function Abc() {
    return (
      <StateMachineProvider>
        <div>
          <h1>Form Wizzard</h1>
  
          <Router>
            <__RegistrationForm />
          </Router>
        </div>
      </StateMachineProvider>
    );
  }

export default Abc;
